     QScriptValue REcmaSharedPointerLineEntity::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RLineEntity* self = getSelf("RLineEntity", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RLineEntity* REcmaSharedPointerLineEntity::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RLineEntity* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RLineEntityPointer >(context->thisObject())
                
                    ->data()
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RLineEntity.%1(): "
                        "This object is not a RLineEntity").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
